package com.iyam.mycash.modelimport android.os.Parcelableimport androidx.annotation.Keepimport kotlinx.parcelize.Parcelizeimport kotlinx.serialization.Serializable@Keep@Parcelize@Serializabledata class Session(    val id: String?,    val date: String?,    val shift: String?,    val startingCash: Double?,    val totalRevenue: Double?,    val checkInTime: String?,    val checkOutTime: String?,    val userId: String?,    val outletId: String?,    val createdAt: String?,    val updatedAt: String?) : Parcelable